1) 오늘은 하준이 학교의 중국인 친구 리엔집에서 플레이데이트가 있는날인데, 아직 차가 한대밖에 없는 우리집 신랑이 차로 출퇴근 하는걸 알고, 아침 일찍 우리집앞에 나랑 준이 픽업하러와준 마음깊은 치엔과의 우정에 너무 감사합니다.

2) 오랫만에 만난 리엔이랑 아침 9시부터~ 4시까지 정말 논스탑으로ㅎㅎ 술래잡기, 엄마아빠놀이, 슈퍼마켓놀이, 그림그리기등 여러가지 재밌는 놀이로 너무 재미있게 놀고, 오랫만에 만난 친구와  너무 사이좋게 잘놀아준  하준이와 리엔에게 너무 감사합니다.

3) 치엔이 7개월전에 셋째를 출산하느라  치엔의 어머니께서 도와주러  와계셨는데, 치엔과 어머니에게 얼굴마사지도 해드리고, 같이 스트레칭도하고 내 친구  샤인킴 @shine_kim_fitness 의 산후 임산부 운동 유튜브 채널도 소개해드리고, 중국 차도 마시고,  즐거운 시간을보낼수있었음에 감사합니다.

4) 영어를 전혀 못하시는 치엔의 어머님과 중국어로 대화를 나누었는데, 3년전에 HSK4급 따르라 배운 중국어를 정말 오랜만에 다시 사용하는건데도, 기억이 생생하게나고, 어머니께서 새로운단어도 많이 가르쳐주셔서 많은걸 배울수있는 귀한 시간이었음에 감사합니다.

5) 언어가 100%프로 통하지는 않아도 진심만 있으면 지구 어떤 사람들과도 마음이 통한다는걸 다시한번 알게되었고, 치엔의 어머니를통해 한국에 혼자계신 엄마생각이 많이 났고, 엄마가 너무 보고싶고 그리고 코로나가 하루빨리 좋아져서 엄마를 캐나다에 초대해서 이 아름다운곳을 하루빨리 보여드리고싶다고 그때까지 내가할수있는 일상에집중하고, 최선을 다해 엄마랑 다시만나는날 더좋은 모습의 ,더 성장한 모습의 나와 내가정을 보여드리고싶은맘에 가슴이 벅찼음에 감사합니다.

6) 식단을 하고있는 나를 존중해주고, 아침일찍 나오느라 내도시락은 삶은 계란밖에 못챙긴 나를위해 샐러드를 만들어준 친국의 따뜻한 마음과 배려에 감사합니다.

